import "./navbar.css"
import {IsAuth} from "../../isAuth/isAuth";


export const NavBar = () => {
    if (IsAuth()) {
        return (
            <div className="navbar">
                <div className="logo">
                    <a href="/" className="logo">NNapp</a>
                </div>
                <div className="links">
                    <a href="" className="link">Logout</a>
                </div>
            </div>
        );
    }
    return (
        <div className="navbar">
            <div className="logo">
                <a href="/" className="logo">NNapp</a>
            </div>
            <div className="links">
                <a href="https://github.com/0azis/" target="_blank" className="link">GitHub</a>
                <a href="" className="link">About</a>
            </div>
        </div>
    );
}
